import React from 'react';
import '../About.css';
import Introduce from '../Introduce';

function About() {
    return (
       <>
        <p>Hello</p>
        <p>Designer - Developer</p>
        <p>I want to close the gap.</p>
        <p>I'm Daekyo Jeong.</p>

        <p>안녕하세요</p>
        <p>디자이너 - 디벨로퍼</p>
        <p>간극을 좁혀보고픈.</p>
        <p>정대교입니다.</p>
       </>
    )
}

export default About;
